ISLAMABAD, Feb 9 (APP):President Pakistan Muslim League-Nawaz Shehbaz Sharif has won the election for National Assembly constituency NA-123 Lahore-VII by securing 63,953 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was independent candidate Afzal Azeem, who bagged 48,486 votes.
